import React from "react";
import Slider from "react-slick";
import parse from "html-react-parser";
import dataBlog from "../data/Blog/blog-data.json";

const ImageSlider = () => {
  const settings = {
    autoplay: true,
    dots: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    className: "owl-carousel blog-slider",
    responsive: [
      {
        breakpoint: 901,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };

  return (
    <section>
      <div className="container">
        <div className="row">
        </div>
        <div className="row mt-50">
          <div className="col-md-12 remove-padding">
            <Slider {...settings}>
              {dataBlog.map((img) => (
                <div className="post" key={img.id}>
                  <div className="post-img">
                    <img
                      className="img-fluid"
                      src={require("../assets/images/carousel/" + img.url)}
                      alt=""
                    />
                  </div>
                </div>
              ))}
            </Slider>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ImageSlider;
